    <pre><textarea class="page-source" readonly>desc: &#39;A la hora de apertura del cine ██████, el personal del establecimiento encuentra la sala █, con capacidad para quinientas trece personas, ocupada por quinientos trece ídolos de piedra tallados con estilo similar a los propios de varias religiones americanas precolombinas. Cada butaca está ocupada por un ídolo orientado hacia la pantalla. La pantalla del cine ha sido sustituida por una representación grabada en madera policromada del Baktun más reciente de la Cuenta Larga, con eventos supuestamente históricos en los que se relata la colonización de Eurasia durante los últimos 400 años estándar. &#39;
date: 19-01-2012
